import React from 'react';

function CreateForm() {
  return (
    <div>
      <form>
        <label htmlFor='name'>
          Name:
          <input type='text' id='name' />
        </label>
        <label htmlFor='email'>
          Email:
          <input type='text' id='email' />
        </label>
        <div className='form-labels'></div>
      </form>
    </div>
  );
}

export default CreateForm;
